//map 함수 사용할 때 : 박스 별로 키 값을 부여->고유한 값으로 식별 가능
import React from 'react';
import detail from "./data/productDetail.js"
import "./Boxb.css"
import LikeButton from "./LikeButton";
import ProductDetail from './pages/ProductDetail.js';

import {
    StyledBox,
    TextContainer,
} from "./styled"

const Boxb = () => {

    return <>{detail.detailProd.map((product)=>(
        <>
            <StyledBox key={product.id}>
                <img src={product.img} alt="no imag"></img>

                    <textitem>
                        <p><b>{product.title}</b></p>
                        <p className="address"> {product.address}</p>
                        <TextContainer>
                            <p className="price"> {product.price}</p>
                            <LikeButton />
                        </TextContainer>
                        <ProductDetail  
                            key={product.id} 
                            title={product.title} 
                            detailID={product.id}/>/>
                    </textitem>


            </StyledBox>
        </>
        ))}
        </>

};

export default Boxb
